        <hr />
        <div className={`${fadeIn ? 'fade-in' : ''}`}>
          <Outlet />
          <Routes>
            <Route exact path="/" element={<Home />} />
            <Route path="/education" element={<Education />} />
            <Route path="/experience" element={<Experience />} />
            <Route path="/contact" element={<Contact />} />
            <Route path="*" element={<NoPage />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
